import React from "react";
import "./WorkshopCard.css";
import logo from "../../assets/images/qr.png"

const WorkshopCard = () => {
  return (
    <div className="card-container">
        <div className="card">
            <img src={logo} alt="Logo" className="img-logo"/>
        </div>
    </div>
  );
};

export default WorkshopCard;
